var title_f18_39_19068="ACC AHA evaluate congenital AS";
var content_f18_39_19068=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F72431&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F72431&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Evaluation and monitoring of asymptomatic adolescents or young adults with aortic stenosis (AS)*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class I - There is evidence and/or general agreement that the following tests should be obtained in asymptomatic adolescents or young adults with AS",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; An electrocardiogram and Doppler echocardiography should be obtained yearly in patients who have a Doppler mean gradient &gt;30 mmHg or a peak velocity &gt;3.5 m/sec (peak gradient &gt;50 mmHg), and every two years in patients who have a Doppler mean gradient less than or equal to 30 mmHg or a peak velocity less than or equal to 3.5 m/sec (peak gradient less than or equal to 50 mmHg).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; Cardiac catheterization when the results of Doppler echocardiography are equivocal for the severity of AS or there is a discrepancy about the severity of AS between the clinical and noninvasive findings.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; Cardiac catheterization if the Doppler mean gradient is &gt;30 mm Hg or the peak velocity is &gt;3.5 m/sec (peak gradient &gt;50 mmHg) in asymptomatic patients who develop T wave invasion at rest over the left precordium, or in symptomatic patients (angina, syncope, or dyspnea on exertion).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Class IIa - The weight of evidence or opinion is in favor of the usefulness of the following tests in the evaluation of asymptomatic adolescents or young adults with AS",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; Graded exercise testing in patients who have a Doppler mean gradient &gt;30 mmHg or a peak velocity &gt;3.5 m/sec (peak gradient &gt;50 mmHg) and want to participate in athletics or have disparate clinical and Doppler findings.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; Cardiac catheterization in patients who have a Doppler mean gradient &gt;40 mmHg or a peak velocity &gt;4.0 m/sec (peak gradient &gt;64 mmHg).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull;&nbsp; Cardiac catheterization in patients who have a Doppler mean gradient &gt;30 mmHg or a peak velocity &gt;3.5 m/sec (peak gradient &gt;50 mmHg) and want to participate in athletics or have disparate clinical and Doppler findings.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * The gradients are usually obtained with the patient sedated. The gradients may be somewhat lower if general anesthesia is used.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Bonow RO, Carabello BA, Chatterjee K, et al. ACC/AHA 2006 guidelines for the management of patients with valvular heart disease. A report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing committee to revise the 1998 guidelines for the management of patients with valvular heart disease). J Am Coll Cardiol 2006; 48:e1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
